import React from 'react'
import './NEOsArea.css'
import Card from '../Card/Card.js'

const NEOsArea = (NEOs) => {
  const cards = []
  if (NEOs) {
  cards = NEOs.map(object => {
    return (
      <Card object={object} />
    )
  })
}

  return (
    <div className='object-area'>
      {cards}
    </div>
  )
}

export default NEOsArea
